import React, { useContext, useState } from 'react';
import styled, { keyframes, createGlobalStyle  } from 'styled-components';
import { FaShoppingCart, FaUserCircle } from 'react-icons/fa';
import { Link, useLocation } from 'react-router-dom';
// import { ProductContext } from '../../Context/ProductContextProvider';


// Animations
const shake = keyframes`
    0%, 100% { transform: rotate(0deg); }
    20%, 60% { transform: rotate(-15deg); }
    40%, 80% { transform: rotate(15deg); }
`;

const activeItems = keyframes`
    0%, 100% { transform: scale(1.1); }
    20%, 60% { transform: scale(1); color: goldenrod; }
    40%, 80% { transform: scale(1.2); }
`;

const pulse = keyframes`
    0%, 100% { transform: scale(1); }
    50% { transform: scale(1.1); color: #7d2f9ed3; }
`;

// Styled Components
const Container = styled.div`
  max-height: 80px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: calc(100% - 245px);
  padding: 20px;
  border-radius: 16px;
  margin: 20px auto;
  background: rgba(142, 68, 173, 0.02);
  box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1);
  backdrop-filter: blur(0px);
  -webkit-backdrop-filter: blur(0px);
  ${({ dark }) => dark && `
    background-color: #1a1a1a;
    color: white;
    margin: 0;
    border-radius: 0;
  `}
`;

const Logo = styled.div`
  color: #8E44AD;
  h1 {
    font-size: 24px;
    font-weight: bold;
  }
`;

const Links = styled.ul`
  list-style: none;
  display: flex;
  gap: 30px;
  padding: 12px 10px;
  ${({ menuOpen }) => menuOpen && `
    flex-direction: column;
    position: fixed;
    top: 0;
    right: 0;
    width: 250px;
    height: 100vh;
    border-radius: 30px 0 0 30px;
    transform: translateX(0);
    backdrop-filter: blur(12px);
    background: rgba(166, 142, 189, 0.85);
    box-shadow: 0 8px 16px rgba(0, 0, 0, 0.2);
    padding-top: 80px;
  `}
  ${({ dark }) => dark && `
    li a {
      color: white;
    }
  `}
`;

const LinkItem = styled.li`
  padding: 5px 0;
  position: relative;
  a {
    text-decoration: none;
    color: black;
    font-size: 18px;
    white-space: nowrap;
    transition: color 0.3s ease;
    &::after {
      content: '';
      position: absolute;
      left: 50%;
      bottom: -3px;
      transform: translateX(-50%);
      width: 0;
      height: 2px;
      background-color: #8E44AD;
      transition: width 0.3s ease;
    }
    &:hover::after {
      width: 100%;
    }
    &:hover {
      color: #8E44AD;
    }
  }
`;

const Hamburger = styled.div`
  width: 2rem;
  height: 2rem;
  position: fixed;
  top: 15px;
  left: 10px;
  z-index: 20;
  display: none;
  flex-direction: column;
  justify-content: space-around;
  cursor: pointer;
  ${({ open }) => open && `
    div:nth-child(1) {
      transform: rotate(45deg);
    }
    div:nth-child(2) {
      transform: translateX(-500%);
      opacity: 0;
    }
    div:nth-child(3) {
      transform: rotate(-45deg);
    }
  `}
  @media (max-width: 899px) {
    display: flex;
  }
`;

const HamburgerLine = styled.div`
  width: 2rem;
  height: 0.25rem;
  background: linear-gradient(135deg, #A68EBD, #8E44AD);
  border-radius: 10px;
  transform-origin: 1px;
  transition: all 0.3s linear;
`;

const IconContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Icon = styled(FaUserCircle)`
  font-size: 30px;
  margin: 10px;
  color: rgb(150, 149, 149);
  transition: color 0.3s ease;
  &:hover {
    color: rgb(121, 79, 158);
    animation: ${shake} 0.4s ease-in-out;
  }
`;

const ItemsSelected = styled(Icon)`
  animation: ${activeItems} infinite 1s ease-in-out;
`;

const Nav = () => {
    const [open, setOpen] = useState(false);
    // const { state } = useContext(ProductContext);
    const location = useLocation();
    const isDarkTheme = location.pathname === '/login' || location.pathname === '/register';

    return (
        <Container dark={isDarkTheme}>
            <Hamburger open={open} onClick={() => setOpen(!open)}>
                <HamburgerLine />
                <HamburgerLine />
                <HamburgerLine />
            </Hamburger>
            <Logo>
                <h1>ویولا</h1>
            </Logo>
            <Links menuOpen={open} dark={isDarkTheme}>
                <LinkItem><Link to="/store">محصولات</Link></LinkItem>
                <LinkItem><Link to="/contact">تماس با ما</Link></LinkItem>
                <LinkItem><Link to="/about">درباره ما</Link></LinkItem>
                <LinkItem><Link to="/">صفحه اصلی</Link></LinkItem>
            </Links>
            <IconContainer>
                <Link to="/dashboard">
                    <Icon />
                </Link>
                <Link to="/cart">
                        as={FaShoppingCart}
                        // selected={state.selectedItems.length > 0}
                </Link>
            </IconContainer>
        </Container>
    );
};

export default Nav;
